import React from "react";

const Footer = () => {
  return (
    <footer className="bg-gray-800 py-4">
      <div className="container mx-auto text-center text-white">
        <p className="text-sm">2024 Todos los derechos reservados</p>
        <p className="text-xs">Footer de prueba y console.error();
        </p>
        <div className="mt-4 grid grid-cols-2 sm:grid-cols-4 gap-2">
        <a href="#" className="text-sm text-gray-300 hover:text-white">Nosotros</a>
        <a href="#" className="text-sm text-gray-300 hover:text-white">Conócenos</a>
        <a href="#" className="text-sm text-gray-300 hover:text-white">Contacto</a>
        <a href="#" className="text-sm text-gray-300 hover:text-white">Términos de servicio</a>
        </div>
        <div className="mt-2"></div> 
      </div>
    </footer>
  );
};

export default Footer;
